import React, { useState, useEffect } from 'react';
import reportsApi from '../api/reports';

const ReportsFeed = () => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [page, setPage] = useState(0);
  const [totalPages, setTotalPages] = useState(0);
  const [totalElements, setTotalElements] = useState(0);
  const pageSize = 10;

  useEffect(() => {
    const fetchReports = async () => {
      try {
        const data = await reportsApi.getReports(page, pageSize);
        setReports(data.content);
        setTotalPages(data.totalPages);
        setTotalElements(data.totalElements);
      } catch (err) {
        setError('Failed to load reports');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchReports();
  }, [page]);

  const handlePageChange = (newPage) => {
    setPage(newPage);
  };

  if (loading) return <div className="bg-white rounded shadow p-4">Loading reports...</div>;
  if (error) return <div className="bg-white rounded shadow p-4 text-red-600">{error}</div>;

  return (
    <div className="bg-white rounded shadow p-4">
      <h3 className="font-bold text-lg mb-4 text-primary-700">Community Reports</h3>
      {reports.length === 0 ? (
        <div className="text-gray-500">No reports yet. Be the first to report a flood in your area!</div>
      ) : (
        <>
          <ul className="divide-y divide-gray-200">
            {reports.map(report => (
              <li key={report.id} className="py-4">
                <div className="flex items-start space-x-4">
                  {report.imageUrl && (
                    <img src={report.imageUrl} alt="Flood report" className="w-20 h-20 object-cover rounded" />
                  )}
                  <div className="flex-1">
                    <h4 className="font-semibold">{report.title}</h4>
                    <p className="text-gray-600 text-sm mt-1">{report.description}</p>
                    <div className="flex items-center space-x-4 mt-2 text-sm text-gray-500">
                      <span className={`px-2 py-1 rounded ${
                        report.severity === 'LOW' ? 'bg-green-100 text-green-800' :
                        report.severity === 'MEDIUM' ? 'bg-yellow-100 text-yellow-800' :
                        report.severity === 'HIGH' ? 'bg-orange-100 text-orange-800' :
                        'bg-red-100 text-red-800'
                      }`}>
                        {report.severity}
                      </span>
                      <span className={`px-2 py-1 rounded ${
                        report.status === 'VERIFIED' ? 'bg-green-100 text-green-800' :
                        report.status === 'PENDING' ? 'bg-yellow-100 text-yellow-800' :
                        'bg-red-100 text-red-800'
                      }`}>
                        {report.status}
                      </span>
                      <span>{new Date(report.createdAt).toLocaleDateString()}</span>
                    </div>
                  </div>
                </div>
              </li>
            ))}
          </ul>

          {/* Pagination */}
          <div className="mt-6 flex items-center justify-between">
            <div className="text-sm text-gray-500">
              Showing {page * pageSize + 1} to {Math.min((page + 1) * pageSize, totalElements)} of {totalElements} reports
            </div>
            <div className="flex space-x-2">
              <button
                onClick={() => handlePageChange(page - 1)}
                disabled={page === 0}
                className={`px-3 py-1 rounded ${
                  page === 0
                    ? 'bg-gray-100 text-gray-400 cursor-not-allowed'
                    : 'bg-primary-100 text-primary-700 hover:bg-primary-200'
                }`}
              >
                Previous
              </button>
              <button
                onClick={() => handlePageChange(page + 1)}
                disabled={page === totalPages - 1}
                className={`px-3 py-1 rounded ${
                  page === totalPages - 1
                    ? 'bg-gray-100 text-gray-400 cursor-not-allowed'
                    : 'bg-primary-100 text-primary-700 hover:bg-primary-200'
                }`}
              >
                Next
              </button>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default ReportsFeed;
